/**
 * pdfContent contains the class that initializes a pdfContent instance.
 * This specific content is used for logos
 * @author Julius Ammerlaan
 * @version 1.0
 * @since 12-03-2019
 */

import { pdfContent } from "./PdfContent"

export class pdfContentLogo extends pdfContent {

    constructor(){
        super();
        this.data = 'data:image/png;base64,';

        // http://www.endmemo.com/sconvert/millimeterpixel.php jsPDF uses a set dpi.
        this.imageWidth = 14.4;
        this.imageheight = 19.8;
    }

    addToDoc(doc, offset) {
        this.setStyle(doc);

        let centerOffset =  (doc.internal.pageSize.getWidth()/2) - (this.imageWidth/2);
        doc.addImage(this.data, 'PNG' , centerOffset , offset, this.imageWidth, this.imageheight);

        return this.imageheight + 1;
    }

    /**
     * sets the text color appropriate for the type.
     */
    setStyle(doc) {
        doc.setTextColor(0, 0, 0);
        doc.setFontSize(18);
        doc.setFont("Times","bold");
    }

    /**
     * returns the correct offset for this pdfContent
     * object
     */
    getOffset() {
        return 1;
    }
}

